INSERT INTO `page` VALUES (10, NULL, NULL, NULL, 'Visi & Misi', 'visi-misi', NULL, NULL, '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:54.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Wingdings;\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">Visi<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54.0pt;mso-add-space:\r\nauto;text-align:justify;line-height:150%\"><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">Menghasilkan insan kesehatan yang beriman, bertakwa,\r\nberakhlak mulia, profesional sesuai kompetensi, terampil, dan mandiri.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54.0pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Wingdings;\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">Misi<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:63.8pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-9.8pt;line-height:150%\"><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">a. Pusat pendidikan\r\nmenengah kejuruan kesehatan yang bermutu dan unggul di jajarannya.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:63.8pt;mso-add-space:\r\nauto;text-align:justify;text-indent:-9.8pt;line-height:150%\"><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">b. Memberikan\r\npendidikan, pengetahuan dan keterampilan yang berkualitas sesuai dengan\r\nperkembangan ilmu pengetahuan dan teknologi (IPTEK) dengan berlandaskan pada\r\niman dan taqwa (IMTAQ).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:18.0pt;text-align:justify;text-indent:\r\n18.0pt;line-height:150%\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:63.8pt;mso-add-space:auto;\r\ntext-align:justify;text-indent:-9.8pt;line-height:150%\"><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">c. Membimbing peserta\r\ndidik untuk menjadi tenaga kesehatan yang berdedikasi tinggi dan terampil\r\nmelakukan kesehatan sesuai bidang kompetensinya.<o:p></o:p></span></p>', NULL);
INSERT INTO `page` VALUES (11, NULL, NULL, NULL, 'Sejarah', 'sejarah', NULL, NULL, '<p class=\"MsoNormal\" style=\"margin-left:18.0pt;text-align:justify;text-indent:\r\n18.0pt;line-height:150%\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ansi-language:IN\">SMK Kesehatan Darussalam\r\nberdiri pada tahun 2013 yang diresmikan oleh Menteri Pendidikan dan Kebudayaan\r\nRepublik Indonesia, Prof. Dr. Ir. KH. Mohammad Nuh, DEA di Desa Gebugan,\r\nKecamatan Bergas, Kabupaten Semarang. SMK Kesehatan Darussalam Bergas merupakan\r\nsekolah yang berbasis Pondok Pesantren di bawah naungan Yayasan Darussalam\r\nBergas. SMK Kesehatan Darussalam adalah satu-satunya SMK Kesehatan di Kabupaten\r\nSemarang yang membuka tiga kompetensi keahlian yaitu </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ansi-language:EN-US\">Layanan Kesehatan dan Caregiver, </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ansi-language:IN\">Teknologi laboratorium Medik</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ansi-language:EN-US\">, dan Teknik Komputer Jaringan</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ansi-language:IN\"> dengan <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">dukungan Sumber Daya Manusia (SDM) yang handal baik internal\r\nmaupun eksternal serta lingkungan yang sangat mendukung proses kegiatan belajar\r\ndan mengajar. <o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0pt;text-align:justify;text-indent:\r\n18.0pt;line-height:150%\"><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Sejak Berdiri tahun 2013, SMK Kesehatan Darussalam\r\nBergas telah menamatkan pertama kali tahun 2016 sejumlah 64 peserta didik dari\r\ndua Kompetensi Keahlian yang sebagian besar bekerja di sektor kesehatan di\r\nberbagai daerah.&nbsp;<o:p></o:p></span></p>', NULL);
