INSERT INTO `page` VALUES (18, NULL, NULL, NULL, 'Keunggulan', 'keunggulan', NULL, NULL, '<p><span style=\"font-family: Arial;\">?</span><span style=\"font-family: Wingdings; font-size: 13.3333px; text-align: justify; text-indent: -24px;\">Ø</span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 10pt; line-height: 150%; font-family: Wingdings;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;</span></span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">Satu-satunya SMK\r\nKesehatan di Kabupaten Semarang yang memiliki dua jurusan kesehatan dan 1\r\njurusan TKJ.</span></p><p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-18.0pt;\r\nline-height:150%;mso-list:l0 level1 lfo1\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\"><o:p></o:p></span></p><p><span style=\"font-family: Wingdings; font-size: 13.3333px; text-align: justify; text-indent: -24px;\">Ø</span><span lang=\"EN-US\" style=\"text-align: justify; text-indent: -18pt; font-size: 10pt; line-height: 150%; font-family: Wingdings;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-size-adjust: none; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-variant-position: normal; font-variant-emoji: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;</span></span><span lan