ansi-theme-font:major-latin\">Profil\r\nKompetensi Keahlian Layanan Kesehatan dan Caregiver<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n27.0pt;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin\">&nbsp;</span></p>\r\n\r\n</div><p>\r\n\r\n<span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><br clear=\"all\" style=\"page-break-before:auto;mso-break-type:section-break\">\r\n</span>\r\n\r\n</p><div class=\"WordSection2\">\r\n\r\n<div>\r\n\r\n<table cellspacing=\"0\" cellpadding=\"0\" hspace=\"0\" vspace=\"0\" align=\"left\">\r\n <tbody><tr>\r\n  <td valign=\"top\" align=\"left\" style=\"padding-top:0cm;padding-right:0cm;\r\n  padding-bottom:0cm;padding-left:0cm\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  35.15pt;mso-line-height-rule:exactly;page-break-after:avoid;vertical-align:\r\n  baseline;mso-element:dropcap-dropped;mso-element-wrap:around;mso-element-anchor-vertical:\r\n  paragraph;mso-element-anchor-horizontal:column;mso-height-rule:exactly;\r\n  mso-element-linespan:2\"><span lang=\"EN-US\" style=\"font-size:38.0pt;mso-bidi-font-size:\r\n  10.0pt;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\n  mso-hansi-theme-font:major-latin;mso-text-raise:1.0pt\">K<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">ompetensi\r\nKeahlian Layanan Kesehatan dan Caregiver merupakan salah satu jurusan di SMK\r\nKesehatan Darussalam Bergas yang bertanggungjawab menghasilkan tenaga kesehatan\r\ndan caregiver yang kompeten dan professional sehingga mampu bersaing di era\r\nglobalisasi. Sebagai tenaga kesehatan, Asisten Perawat juga harus memenuhi tiga\r\nkompetensi, yaitu <i>high skill, high\r\nknowledge</i>, dan <i>high attitude</i>\r\nsebagai tolak ukur baik secara langsung maupun tidak langsung bagi masyarakat\r\nuntuk menilai profesionalitas Asisten Perawat. Demi kemajuan kompetensi\r\nkeahlian khususnya dan SMK pada umumnya, berusaha untuk terus mengikuti\r\nperkembangan ilmu pengetahuan dan teknologi serta tetap mengedepankan nilai\r\netika kepada peserta didik.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n27.0pt;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin\">Peserta didik tidak hanya bisa menjadi Asisten Perawat, akan\r\ntetapi dapat melanjutkan ke jenjang yang lebih tinggi sebagai Diploma ataupun\r\nSarjana baik di dalam negeri maupun di luar negeri. Banyak peserta didik yang\r\nmelanjutkan ke jenjang berikutnya dengan mengambil jurusan yang linier sangat\r\nmerasakan keuntungan tersendiri karena sudah lebih memahami dasar-dasar dari\r\nilmu keperawatan yang akan terus berkembang di bangku kuliah. Bagi peserta\r\ndidik yang tidak melanjutkan ke jenjang berikutnya, bekerja sebagai Asisten\r\nPerawat di Rumah Sakit ataupun Klinik dan sebagai <i>caregiver</i> baik di dalam negeri ataupun di luar negeri.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n27.0pt;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin\">Kompetensi Keahlian Layanan Kesehatan dan Caregiver menjadi\r\npilihan yang tepat apabila tertarik di bidang kesehatan dan keperawatan.\r\nMelalui Kompetensi Keahlian Layanan Kesehatan dan Caregiver, peserta didik\r\ndapat meningkatkan <i>soft skill</i> dan <i>hard skill</i> bersamaan terutama dalam\r\nbidang kesehatan. Dengan bergabung menjadi bagian dari Kompetensi Keahlian\r\nLayanan Kesehatan dan Caregiver akan banyak belajar tentang anatomi fisiologi tubuh\r\nmanusia, komunikasi yang baik, rasa empati, pemenuhan kebutuhan dasar manusia, berbagai\r\nmacam jenis penyakit, membuat dokumentasi keperawatan, membaca hasil\r\nlaboatorium, dan berbagai macam tindakan keperawatan.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n27.0pt;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin\">Kompetensi Keahlian Layanan Kesehatan dan Caregiver menggunakan\r\nkurikulum merdeka berbasis Pembelajaran Mendalam sesuai dengan peraturan\r\npemerintah dan peraturan menteri. Kurikulum merdeka berbasis Pembelajaran\r\nMendalam ini mempunyai 8 dimensi profil lulusan, diantaranya keimanan dan\r\nketakwaan, kewarganegaraan, penalaran kritis, kreatifitas, kolaborasi,\r\nkemandirian dan komunikasi. Aspek dari kurikulum ini sudah sesuai dengan kompetensi\r\nyang harus dipenuhi oleh tenaga kesehatan. Tidak hanya itu, Kompetensi Keahlian\r\nLayanan Kesehatan dan Caregiver juga memiliki 5 tenaga pendidik yang handal dan\r\nprofessional. Kelima tenaga pendidik memiliki latar belakang pendidikan yang\r\nsesuai dengan bidang keperawatan sebagai Sarjana Keperawatan. Demi meningkatkan\r\nkualitas tenaga pendidik, sebagian tenaga pendidik telah bersertifikat Asesor\r\nsebagai penguji tingkat nasional.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n27.0pt;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin\">SMK Kesehatan Darussalam Bergas khususnya Kompetensi Keahlian\r\nLayanan Kesehatan dan Caregiver bekerjasama dengan beberapa Rumah Sakit di\r\nKabupaten Semarang dan sekitarnya untuk memenuhi program kejuruan, yaitu\r\nPraktik Belajar Lapangan yang meliputi pembelajaran <i>sofskill</i> dan <i>hardskill</i> secara\r\nlangsung di Rumah Sakit yang dilaksanakan di kelas XII selama kurang lebih 3\r\nbulan. Selanjutnya, peserta didik wajib mengikuti Uji Sertifikasi Kompetensi (USK)\r\nuntuk menilai <i>softskill</i> dan <i>hardskill</i> yang telah dipelajari selama 3\r\ntahun. Uji Sertifikasi Kompetensi ini dilaksanakan oleh LSP Asnakes Indonesia\r\ntingkat Nasional dan akan mendapatkan sertifikat yang berlaku selama 3 tahun\r\nsebagai bukti bahwa peserta didik kompeten dan memenuhi syarat sebagai Asisten\r\nPerawat.<o:p></o:p></span></p>\r\n\r\n</div><p>\r\n\r\n<span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">\r\n</span>\r\n\r\n</p><table class=\"MsoTable15Plain4\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n <tbody><tr>\r\n  <td width=\"308\" valign=\"top\" style=\"width:231.05pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  150%;mso-yfti-cnfc:5\"><b><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n  150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\n  major-latin;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype id=\"_x0000_t75\"\r\n   coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\" path=\"m@4@5l@4@11@9@11@9@5xe\"\r\n   filled=\"f\" stroked=\"f\">\r\n   <v:stroke joinstyle=\"miter\"/>\r\n   <v:formulas>\r\n    <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n    <v:f eqn=\"sum @0 1 0\"/>\r\n    <v:f eqn=\"sum 0 0 @1\"/>\r\n    <v:f eqn=\"prod @2 1 2\"/>\r\n    <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n    <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n    <v:f eqn=\"sum @0 0 1\"/>\r\n    <v:f eqn=\"prod @6 1 2\"/>\r\n    <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n    <v:f eqn=\"sum @8 21600 0\"/>\r\n    <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n    <v:f eq