INSERT INTO `page` VALUES (20, NULL, NULL, NULL, 'TKJ', 'tkj', NULL, NULL, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Profil Teknik Komputer Jaringan <o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Kompetensi Keahlian Teknik Komputer Jaringan merupakan\r\nsalah satu jurusan di SMK Kesehatan Darussalam Bergas, yang bertanggungjawab\r\nmenghasilkan tenaga teknik komputer jaringan yang kompeten, dan mampu bersaing\r\ndi era globalisasi. Jurusan Teknik Komputer dan Jaringan (TKJ) adalah keahlian\r\nprogram yang fokus pada penguasaan teknologi komputer, jaringan komputer, dan\r\nsistem komunikasi digital.&nbsp;Siswa TKJ dibekali kemampuan merakit,\r\nmenginstal, memelihara, dan memperbaiki komputer serta jaringannya.&nbsp;Mereka\r\njuga mempelajari perancangan, pembangunan, dan pengelolaan jaringan komputer.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Adapun prospek kelulusan sangat diperlukan di\r\nlapangan, misal jadi teknisi kompuer, yang mana mampu merakit, memperbaiki, dan\r\nmerawat komputer serta perangkat keras lainnya.&nbsp;Selain itu bisa menjadi\r\nadministrator Jaringan, mampu menginstal, mengkonfigurasi, dan mengelola\r\njaringan komputer, baik LAN maupun WAN.&nbsp;Spesialis Keamanan Jaringan: memahami\r\nkonsep keamanan jaringan dan mampu melindungi jaringan dari serangan.&nbsp;Tenaga\r\nPendukung IT: memberikan dukungan teknis kepada pengguna dalam mengatasi\r\nmasalah komputer dan jaringan.&nbsp;Arsitek/Insinyur Jaringan: merancang,\r\nmengimplementasikan, dan mengelola jaringan computer, dan masih banyak lagi\r\nprofesi yang linier dengan kompetensi keahlian ini. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Mata Pelajaran yang Dipelajari meliputi perakitan dan\r\nperbaikan Komputer, mempelajari komponen komputer, merakit, dan memperbaiki\r\nkerusakan.&nbsp;Sistem Operasi:&nbsp;menguasai sistem operasi seperti Windows\r\ndan Linux.&nbsp;Jaringan Komputer:&nbsp;memahami konsep LAN, WAN, dan internet,\r\nserta cara pengaturan dan pengelolaan jaringan.&nbsp;Administrasi Server:&nbsp;mengelola\r\nserver seperti web server dan database server.&nbsp;Keamanan Jaringan:&nbsp;mempelajari\r\nfirewall, VPN, enkripsi data, dan ancaman keamanan jaringan.&nbsp;Pemrograman:&nbsp;pemrograman\r\nweb, database, dan bahasa pemrograman lain seperti Java, C++, dan Python.&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Peluang Karir dalam kompetensi ini diantaranya teknisi\r\nKomputer dan Jaringan di berbagai perusahaan dan organisasi, administrator\r\nJaringan di perusahaan, sekolah, atau instansi pemerintah, spesialis Keamanan\r\nJaringan. Arsitek/Insinyur Jaringan. Peluang untuk melanjutkan pendidikan ke\r\njenjang yang lebih tinggi di bidang Teknik Informatika, Ilmu Komputer, atau\r\njurusan terkait.&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:\r\n&quot;Times New Roman&quot;,serif\">Kompetensi Keahlian dalam Teknik Komputer Jaringan ini\r\nmenguasai kemampuan berpikir logistik dan analitis, keterampilan pemecahan\r\nmasalah, kemampuan bekerja secara mandiri maupun dalam tim, keterampilan\r\nkomunikasi dan interpersonal, kreativitas dan inovasi.&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">Jurusan\r\nTKJ sangat relevan dengan perkembangan teknologi saat ini, dimana jaringan\r\nkomputer dan sistem informasi memegang peranan penting dalam berbagai\r\nsektor.&nbsp;Lulusan TKJ memiliki prospek karir yang luas dan dibutuhkan diberbagai\r\nbidang.&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p><table class=\"MsoTable15Plain4\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"636\" style=\"width: 477.3pt;\">\r\n <tbody><tr style=\"mso-yfti-irow:-1;mso-yfti-firstrow:yes;mso-yfti-lastfirstrow:yes;\r\n  mso-yfti-lastrow:yes;height:183.5pt\">\r\n  <td width=\"313\" valign=\"top\" style=\"width:234.45pt;padding:0cm 5.4pt 0cm 5.4pt;\r\n  height:183.5pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  150%;mso-yfti-cnfc:5\"><b><span lang=\"EN-US\" style=\"font-size:12.0pt;line-height:\r\n  150%;font-family:&quot;Times New Roman&quot;,serif;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype\r\n   id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n   path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n   <v:stroke joinstyle=\"miter\"/>\r\n   <v:formulas>\r\n    <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n    <v:f eqn=\"sum @0 1 0\"/>\r\n    <v:f eqn=\"sum 0 0 @1\"/>\r\n    