/td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:17.35pt;line-height:150%;vertical-align:\r\nbaseline\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-fareast-language:IN\">ompetensi Keahlian\r\nTeknologi </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nIN\">&nbsp;&nbsp;</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-fareast-language:IN\">Laboratorium Medik\r\nadalah </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nIN\">salah satu </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-fareast-language:IN\">jurusan yang&nbsp;ada\r\ndi SMK Kesehatan Darussalam Bergas. Kompetensi Keahlian Teknologi Laboratorium\r\nMedik</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nIN\"> </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nIN\">atau biasa disebut TLM </span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\nmso-fareast-language:IN\">merupakan suatu pendidikan yang bergerak di bidang\r\nLaboratorium Kesehatan. </span><span lang=\"EN-US\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:IN\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:17.35pt;text-indent:36.0pt;line-height:\r\n150%;vertical-align:baseline\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-fareast-language:IN\">Kompetensi </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nIN\">Keahlian ini memang belum familiar di masyarakat, namun dalam dunia kerja\r\ndi rumah sakit maupun klinik, TLM memiliki peran penting dalam meneliti penyakit\r\nyang diderita pasien. Peserta didik akan banyak belajar tentang </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-fareast-language:IN\">hematologi, kimia\r\nklinik, mikrobiologi, imunoserologi, </span><span lang=\"EN-US\" style=\"font-size:\r\n10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:IN\">dan </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-fareast-language:IN\">histologi. </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nIN\">Melalui Kompetensi Keahlian ini, peserta didik dapat meningkatkan <i>soft skill </i>antara lain t</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;mso-fareast-language:IN\">erampil\r\ndalam&nbsp;melakukan pengujian/analisis jenis penyakit, penyebab penyakit,\r\nkondisi kesehatan dan faktor-faktor lain yang berpengaruh pada kesehatan.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:17.35pt;text-indent:36.0pt;line-height:\r\n150%;vertical-align:baseline\"><span lang=\"EN-US\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:IN\">Selain itu, peserta didik juga\r\nbelajar </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi\">anatomi\r\nfisiologi tubuh manusia, berbagai macam jenis penyakit, dasar manajemen\r\nlaboratorium dan kesehatan lingkungan, </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US\">mengenai\r\n</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi\">cairan tubuh</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US\">\r\nmanusia, juga</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi\">\r\nmempelajari tentang bagaimana cara pengolahan jaringan pada tubuh manusia\r\ndimana pemeriksaan tersebut membantu dokter dalam bidang patologi anatomi.</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:IN\"> </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">Yang tidak kalah penting yaitu bagaimana </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;mso-ansi-language:EN-US\">cara\r\nber</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi\">komunikasi\r\nyang baik</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\nmso-ansi-language:EN-US\"> dengan pasien. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:17.35pt;text-indent:36.0pt;line-height:\r\n150%;vertical-align:baseline\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin\">Kompetensi Keahlian</span><span lang=\"EN-US\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-hansi-theme-font:major-latin;mso-ansi-language:EN-US\"> Teknologi\r\nLaboratorium Medik </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:\r\nmajor-latin\">menggunakan kurikulum merdeka berbasis Pembelajaran Mendalam\r\nsesuai dengan peraturan pemerintah dan peraturan menteri. Kurikulum merdeka\r\nberbasis Pembelajaran Mendalam ini mempunyai 8 dimensi profil lulusan,\r\ndiantaranya keimanan dan ketakwaan, kewarganegaraan, penalaran kritis,\r\nkreatifitas, kolaborasi, kemandirian dan komunikasi. Aspek dari kurikulum ini\r\nsudah sesuai dengan kompetensi yang harus dipenuhi oleh tenaga kesehatan.</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:IN\">\r\nKompetensi keahlian TLM di SMK Kesehatan Darussalam juga memiliki dua tenaga\r\npendidik yang handal dan profesional. Kedua tenaga pendidik tersebut&nbsp; memiliki latar belakang pendidikan yang\r\nsesuai dengan bidang Teknologi Laboratorium Medik. </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">S</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\">atu diantaranya telah bersertifikat\r\nsebagai Assesor sebagai penguji tingkat nasional. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:17.35pt;text-indent:36.0pt;line-height:\r\n150%;vertical-align:baseline\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:\r\nIN\">SMK Kesehatan Darussalam Bergas khususnya </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">Jurusan ini, </span><span lang=\"IN\" style=\"font-size:\r\n10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\">bekerjasama dengan beberapa Rumah Sakit\r\ndi Kabupaten Semarang dan sekitarnya untuk memenuhi program kejuruan yaitu </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">PBL (</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\">Praktik Belajar Lapangan</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">)</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\">. P</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">BL</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\"> meliputi pembelajaran <i>softskill</i>\r\ndan <i>hardskill</i></span><i><span lang=\"IN\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:\r\nEN-US;mso-fareast-language:IN\"> </span></i><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\">secara langsung di Rumah Sakit yang\r\ndilaksanakan di kelas XI</span><span lang=\"EN-US\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-ansi-language:EN-US;mso-fareast-language:IN\">I</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:IN\"> </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">pada semester genap </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:IN\">selama\r\nkurang lebih 3 bulan</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:\r\nEN-US;mso-fareast-language:IN\">.</span><span lang=\"EN-US\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\"> </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">Kemudian, </span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\">peseta didik wajib mengikuti Uji\r\nSertifikasi Kompetensi (USK) yang dilaksanakan oleh LSP Asnakes Indonesia\r\ntingkat Nasional</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:\r\nEN-US;mso-fareast-language:IN\"> dengan tujuan agar siswa mendapatkan Sertifikat\r\nKompeten </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:\r\nIN\">Nasional sebagai bukti bahwa peserta didik kompeten dan memenuhi syarat\r\nsebagai Asisten Teknologi Laboratorium Medik.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:17.35pt;text-indent:36.0pt;line-height:\r\n150%;vertical-align:baseline\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;color:#111111;mso-fareast-language:IN\">Prospek\r\nKerja Kompetensi Keahlian Teknologi Laboratorium Medik (TLM)</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:IN\"> yaitu </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;color:#222222;mso-fareast-language:IN\">dapat\r\nbekerja sebagai Asisten Teknologi Laboratorium Medik di laboratorium Rumah\r\nSakit pemerintah maupun swasta,</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\ncolor:#222222;mso-ansi-language:EN-US;mso-fareast-language:IN\"> </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;color:#222222;mso-fareast-language:IN\">ahli\r\nkontrol kualitas di perusahaan makanan dan minuman, dan bidang kesehatan</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;color:#222222;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\"> lain</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\ncolor:#222222;mso-fareast-language:IN\"> yang berkaitan dengan laboratorium.\r\nSelain itu</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;color:#222222;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">,</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\ncolor:#222222;mso-fareast-language:IN\"> lulusan dari kompetensi TLM juga bisa\r\nmelanjutkan ke jenjang yang lebih tinggi yaitu </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;color:#222222;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN\">d</span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\ncolor:#222222;mso-fareast-language:IN\">iploma atau sarjana dibidang kesehatan.</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;color:#333333;mso-fareast-language:IN\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:17.35pt;text-indent:36.0pt;line-height:\r\n150%;vertical-align:baseline\"><span lang=\"EN-US\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:IN\">Adapun visi Kompetensi\r\nKeahlian TLM ialah </span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:\r\n150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;color:#333333;mso-ansi-language:\r\nEN-US;mso-fareast-language:IN\">menjadikan program studi Teknologi Laboratorium\r\nMedik yang unggul dalam bidang asisten pemeriksaan laboratorium yang\r\nberkarakter dan kompeten. Sedangkan misinya adalah (1) melaksanakan pendidikan Teknologi\r\nLaboratorium Medik yang menghasilkan lulusan yang religius, disiplin dan terampil\r\ndi bidang asisten pemeriksaan laboratorium; (2) Memberikan kontribusi dalam bentuk\r\npengabdian di bidang pemeriksaan laboratorium untuk meningkatkan kesadaran masyarakat\r\ndalam kesehatan; dan (3) menggalang kemitraan untuk membangun kerja sama dalam pemenuhan\r\nkebutuhan lahan praktek, &nbsp;sumber daya kesehatan\r\ndengan instansi terkait. </span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\ncolor:#333333;mso-fareast-language:IN\"><o:p></o:p></span></p>\r\n\r\n</div><p style=\"text-align: center;\">\r\n\r\n<b><span lang=\"IN\" style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:\r\n115%;font-family:&quot;Times New Roman&quot;,serif;mso-ascii-theme-font:major-bidi;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nmajor-bidi;mso-bidi-theme-font:major-bidi;mso-ansi-language:IN;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\"><br clear=\"all\" style=\"page-break-before:auto;\r\nmso-break-type:section-break\">\r\n</span></b>\r\n\r\n</p><table class=\"MsoTableGrid\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"678\" style=\"text-align: center; width: 508.65pt; border: none;\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes;\r\n  height:195.4pt\">\r\n  <td width=\"330\" valign=\"top\" style=\"width:247.55pt;padding:0cm 5.4pt 0cm 5.4pt;\r\n  height:195.4pt\">\r\n  <p class=\"MsoNormal\" style=\"line-height:115%\"><b><span lang=\"IN\"><!--[if gte vml 1]><v:shape\r\n   id=\"Picture_x0020_1\" o:spid=\"_x0000_i1026\" type=\"#_x0000_t75\" style=\'width:235.5pt;\r\n   height:176.5pt;visibility:visible;mso-wrap-style:square\'>\r\n   <v:imagedata src=\"file:///C:/Users/DELL/AppData/Local/Temp/msohtmlclip1/01/clip_image003.jpg\"\r\n    o:title=\"\" croptop=\"21081f\" cropbottom=\"17035f\"/>\r\n  </v:shape><![endif]--><!--[if !vml]--><img width=\"314\" height=\"235\" src=\"data:image/jpeg;base64,\" v:shapes=\"Picture_x0020_1\"><!--[endif]--></span></b><b><span lang=\"IN\"><o:p></o:p></span></b></p>\r\n  </td>\r\n  <td width=\"348\" valign=\"top\" style=\"width:261.1pt;padding:0cm 5.4pt 0cm 5.4pt;\r\n  height:195.4pt\">\r\n  <p class=\"MsoNormal\" style=\"line-height:115%\"><b><span lang=\"IN\"><!--[if gte vml 1]><v:shape\r\n   id=\"Picture_x0020_2\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\" style=\'width:249.5pt;\r\n   height:176pt;visibility:visible;mso-wrap-style:square\'>\r\n   <v:imagedata src=\"file:///C:/Users/DELL/AppData/Local/Temp/msohtmlclip1/01/clip_image005.jpg\"\r\n    o:title=\"\"/>\r\n  </v:shape><![endif]--><!--[if !vml]--><img width=\"333\" height=\"235\" src=\"data:image/jpeg;base64,\" v:shapes=\"Picture_x0020_2\"><!--[endif]--></span></b><b><span lang=\"IN\"><o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n</tbody></table><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height:115%\"><b><span lang=\"IN\">&nbsp;</span></b></p>', NULL);
INSERT INTO `page` VALUES (22, NULL, NULL, NULL, 'OSIS', 'osis', NULL, NULL, '<h3 style=\"text-align: center; \"><p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom: 0cm; line-height: 150%;\"><b><span lang=\"IN\" style=\"font-size:16.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">TENTANG OSIS\r\nSMK KESEHATAN DARUSSALAM&nbsp;</span></b></p></h3>\r\n\r\n<p><strong>Organisasi Siswa Intra Sekolah</strong> (disingkat OSIS) adalah suatu organisasi yang berada di tingkat sekolah di Indonesia yang dimulai dari Sekolah Menengah yaitu Sekolah Menengah Pertama (SMP) dan Sekolah Menengah Atas (SMA). OSIS SMK Kesehatan Darussalam diurus dan dikelola oleh para siswa terpilih untuk menjadi pengurus OSIS. Organisasi ini memiliki seorang pembimbing dari guru yang dipilih oleh pihak sekolah.</p>\r\n\r\n<p>Tujuan OSIS SMK Kesehatan Darussalam adalah untuk membantu terwujudnya pendidikan dan pembinaan generasi muda sebagaimana tertuang dalam Pembukaan UUD 1945 dan GBHN, dengan menjadikan sekolah sebagai lingkungan pendidikan yang strategis melalui proses belajar mengajar serta kegiatan kokurikuler dan ekstrakurikuler.</p>\r\n\r\n<h4><b style=\"text-align: justify; font-size: 16px;\"><span lang=\"IN\" style=\"font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">Wawasan\r\nWiyatamandala</span></b></h4><h4><span style=\"font-size: 16px;\">Dalam rangka mewujudkan sekolah sebagai lingkungan pendidikan (Wiyatamandala), pembinaan kesiswaan perlu dilaksanakan dengan baik. Berdasarkan surat Dirjen Dikdasmen Nomor: 13090/CI.84 tanggal 1 Oktober 1984, konsep Wawasan Wiyatamandala mengandung prinsip-prinsip berikut:</span></h4>\r\n\r\n<ul>\r\n  <li>Sekolah merupakan Wiyatamandala (lingkungan pendidikan), sehingga tidak boleh digunakan untuk tujuan di luar pendidikan.</li>\r\n  <li>Kepala Sekolah memiliki wewenang dan tanggung jawab penuh dalam menyelenggarakan proses pendidikan berdasarkan Pancasila, dengan tujuan:\r\n    <ol type=\"1\">\r\n      <li>Meningkatkan ketakwaan terhadap Tuhan Yang Maha Esa</li>\r\n      <li>Meningkatkan kecerdasan dan keterampilan</li>\r\n      <li>Mempertinggi budi pekerti</li>\r\n      <li>Memperkuat kepribadian</li>\r\n      <li>Mempertebal semangat kebangsaan dan cinta tanah air</li>\r\n    </ol>\r\n  </li>\r\n  <li>Guru dan orang tua siswa harus menjalin pengertian dan kerja sama yang baik dalam tugas pendidikan.</li>\r\n  <li>Guru harus senantiasa menjunjung tinggi martabat dan citra sebagai pendidik.</li>\r\n  <li>Sekolah harus berinteraksi dengan masyarakat, namun tetap menjaga nilai-nilai pendidikan agar tidak terganggu oleh pengaruh luar.</li>\r\n</ul>\r\n\r\n<p>Untuk mengimplementasikan Wawasan Wiyatamandala, sekolah menciptakan suasana yang harmonis, nyaman, dan menciptakan kecintaan siswa terhadap sekolah sehingga kegiatan belajar dan kegiatan siswa dapat berjalan dengan baik. OSIS menjadi bagian penting dalam mewujudkan hal tersebut, bersama dengan menciptakan lingkungan yang aman, bersih, tertib, indah, dan kekeluargaan.</p><p><b style=\"text-align: justify;\"><span lang=\"IN\" style=\"font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">Struktur\r\nOrganisasi OSIS SMK Kesehatan Darussalam </span></b><b style=\"text-align: justify;\"><span lang=\"EN-US\" style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-ansi-language:EN-US\">Bergas\r\nTahun 2025 -2026</span></b></p><ul><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><b><span lang=\"EN-US\" style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin;mso-ansi-language:EN-US\"><o:p></o:p></span></b></p><li><strong>Ketua Pembina:</strong> Muhaimin, S.Ag., M.Pd. (Kepala Sekolah)</li>\r\n  <li><strong>Wakil Ketua Pembina:</strong> Warda Latif Fiana, S.Kep Ns., Gr (Wakil Kepsek Bidang Kesiswaan)</li>\r\n  <li><strong>Pembina:</strong> Friesta Puspasari, S.Pd., Gr</li>\r\n  <li><strong>Ketua OSIS:</strong> Febi Adelia Kanaya</li>\r\n  <li><strong>Wakil Ketua OSIS:</strong> Muhammad Wa’akhrimudhin</li>\r\n  <li><strong>Sekretaris I:</strong> Aliya Digita</li>\r\n  <li><strong>Sekretaris II:</strong> Natasya Vebrianti Rihi</li>\r\n  <li><strong>Sekretaris III:</strong> Nafi’ Mazidatul Hikmah</li>\r\n  <li><strong>Bendahara I:</strong> Luna Attamimi</li>\r\n  <li><strong>Bendahara II:</strong> Zaskia Zalianty</li>\r\n  <li><strong>Bendahara III:</strong> Nadia Azzahra</li>\r\n</ul>\r\n\r\n<p><strong>Koordinator Bidang (KOBID)</strong> dan <strong>Seksi Bidang (SEKBID)</strong> bertugas membantu koordinasi kegiatan ekstrakurikuler dan bidang lainnya sesuai tanggung jawab masing-masing.</p>\r\n\r\n<h4><b style=\"text-align: justify; font-size: 16px;\"><span lang=\"IN\" style=\"font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">Program\r\nKerja OSIS</span></b></h4><h4><span style=\"font-size: 16px;\">Kegiatan rutin OSIS SMK Kesehatan Darussalam antara lain:</span></h4>\r\n<ol>\r\n  <li>Melaksanakan upacara bendera</li>\r\n  <li>Melakukan peringatan HUT RI</li>\r\n  <li>Melakukan peringatan Hari Olahraga Nasional</li>\r\n  <li>Melakukan peringatan Bulan Bahasa</li>\r\n  <li>Mengisi kegiatan class meeting</li>\r\n  <li>Bekerja sama dengan guru BK untuk melakukan razia dalam rangka penegakan disiplin</li>\r\n  <li>Melakukan pengibaran dan penurunan bendera setiap hari</li>\r\n</ol>\r\n\r\n<p><em>Demikian sekilas informasi tentang OSIS SMK Kesehatan Darussalam Bergas.</em></p><p><em><br></em></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-lati