-></span></b><b><span lang=\"IN\" style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\n  mso-hansi-theme-font:major-latin\"><o:p></o:p></span></b></p>\r\n  </td>\r\n  <td width=\"319\" valign=\"top\" style=\"width:239.5pt;padding:0cm 5.4pt 0cm 5.4pt;\r\n  height:161.5pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  150%;mso-yfti-cnfc:1\"><b><span lang=\"IN\" style=\"font-family:&quot;Cambria&quot;,serif;\r\n  mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-no-proof:\r\n  yes\"><!--[if gte vml 1]><v:shape id=\"Picture_x0020_2\" o:spid=\"_x0000_i1025\"\r\n   type=\"#_x0000_t75\" style=\'width:249.5pt;height:139.5pt;visibility:visible;\r\n   mso-wrap-style:square\'>\r\n   <v:imagedata src=\"file:///C:/Users/DELL/AppData/Local/Temp/msohtmlclip1/01/clip_image003.jpg\"\r\n    o:title=\"\"/>\r\n  </v:shape><![endif]--><!--[if !vml]--><img width=\"333\" height=\"186\" src=\"data:image/jpeg;base64,\" v:shapes=\"Picture_x0020_2\"><!--[endif]--></span></b><b><span lang=\"IN\" style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\n  mso-hansi-theme-font:major-latin\"><o:p></o:p></span></b></p>\r\n  </td>\r\n </tr>\r\n</tbody></table><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:\r\nmajor-latin;mso-hansi-theme-font:major-latin\">&nbsp;</span></p>', NULL);
INSERT INTO `page` VALUES (23, NULL, NULL, NULL, 'Rohis', 'rohis', NULL, NULL, '<div class=\"WordSection1\">\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0cm;text-align:center;\r\nline-height:normal\"><span lang=\"EN-US\" style=\"font-size:20.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:EN-US\">Profil Ekstrakurikuler Rohani Islam (Rohis)</span></p></div><p>\r\n\r\n<span lang=\"IN\" style=\"font-size:11.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:Calibri;mso-ansi-language:IN;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\"><br clear=\"all\" style=\"page-break-before:auto;\r\nmso-break-type:section-break\">\r\n</span>\r\n\r\n</p><div class=\"WordSection3\">\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:\r\nEN-US\">R</span><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">ohani\r\nIslam atau biasa disebut dengan rohis adalah organisasi himpunan &nbsp;remaja muslim yang aktif dalam kegiatan\r\nkeagamaan. Di SMK Kesehatan Darussalam terdapat ekstrakurikuler Rohis. Untuk\r\nmembangun&nbsp; generasi Remaja&nbsp; Islam yang kreatif&nbsp; serta agamis, maka Organisasi Rohis ini\r\nsangat cocok untuk perkumpulan remaja-remaja&nbsp;\r\nIslam yang ingin mengembangkan bakat mereka di bidang agama khususnya\r\ndalam konteks keberagaman suku dan budaya yang berbeda.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">Ekstrakurikuler\r\nRohis merupakan&nbsp; pionir perubahan&nbsp; yang ditiru oleh para siswa&nbsp; karena&nbsp;\r\ndapat&nbsp; menyeimbangkan&nbsp; antara&nbsp;\r\npenguasaan&nbsp; ilmu&nbsp; pengetahuan&nbsp;\r\ndan teknologi serta pengamalan niai-nilai ajaran islam dalam\r\nkehidupan&nbsp; sehari-hari. Sehingga\r\nmembentuk kepribadian&nbsp; muslim&nbsp; yang representatif&nbsp; dan berkesinambungan. Adapun ekstrakurikuler\r\nRohis memiliki peran dan fungsi dalam&nbsp;\r\npengembangan Pendidikan Agama Islam antara lain untuk&nbsp; meningkatkan&nbsp;\r\npengetahuan,&nbsp;&nbsp; pemahaman,&nbsp;&nbsp; dan&nbsp;\r\npengamalan&nbsp; ajaran Islam. Selain\r\nitu untuk meningkatkan&nbsp; pengalaman\r\nkepemimpinan&nbsp; dalam kepengurusan yang\r\nmampu menggerakkan pihak-pihak lain dalam berorganisasi Islam di SMK Kesehatan\r\nDarussalam untuk mengharumkan&nbsp;\r\nsyi’ar&nbsp; Islam&nbsp; di Bumi&nbsp;\r\nSerambi Mekkah. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><b><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">TUJUAN ROHIS SMK KESDA<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:1.0cm;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">Ekstrakurikuler\r\nRohis memiliki tujuan&nbsp; yaitu antara lain\r\nmemberikan pembekalan kepada pengurus Rohis SMK Kesehatan Darussalam Bergas\r\ntentang manajemen pengelolaan organisasi, sehingga diharapkan mampu\r\nmeningkatkan kualitas serta profesionalisme dalam melaksanakan program kerja\r\nekstrakurikuler Rohis. Tujuan selanjutnya yaitu menumbuhkan jiwa kepemimpinan\r\ndan rasa kepedulian sosial terbadap realitas yang berkembang, baik dilingkungan\r\nsekolah maupun di masyarakat. Kemudian, meningkatkan pengetahuan, ketrampilan,\r\nkemampuan serta pengalaman dalam manajemen pengelolaan organisasi Rohis SMK\r\nKesehatan Darussalam Bergas. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">Adapun program\r\nkegiatan ekstrakurikuler Rohis yaitu pembelajaran Islam lewat metode kelompok\r\nsetiap minggu, pembelajaran Islam di alam terbuka, perbaikan bacaan Alquran\r\ndengan tajwid aplikatif (tahsin), Baca Tulis AlQuran, marawis, sholawat,\r\nQiraat, pengajian bulanan dan masih banyak lagi. </span><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">R</span><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">ohani Islam atau biasa\r\ndisebut dengan rohis adalah organisasi himpunan&nbsp;\r\nremaja muslim yang aktif dalam kegiatan keagamaan. Di SMK Kesehatan\r\nDarussalam terdapat ekstrakurikuler Rohis. Untuk membangun&nbsp; generasi Remaja&nbsp; Islam yang kreatif&nbsp; serta agamis, maka Organisasi Rohis ini\r\nsangat cocok untuk perkumpulan remaja-remaja&nbsp;\r\nIslam yang ingin mengembangkan bakat mereka di bidang agama khususnya\r\ndalam konteks keberagaman suku dan budaya yang berbeda.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:36.0pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">Ekstrakurikuler\r\nRohis merupakan&nbsp; pionir perubahan&nbsp; yang ditiru oleh para siswa&nbsp; karena&nbsp;\r\ndapat&nbsp; menyeimbangkan&nbsp; antara&nbsp;\r\npenguasaan&nbsp; ilmu&nbsp; pengetahuan&nbsp;\r\ndan teknologi serta pengamalan niai-nilai ajaran islam dalam\r\nkehidupan&nbsp; sehari-hari. Sehingga\r\nmembentuk kepribadian&nbsp; muslim&nbsp; yang representatif&nbsp; dan berkesinambungan. Adapun ekstrakurikuler\r\nRohis memiliki peran dan fungsi dalam&nbsp;\r\npengembangan Pendidikan Agama Islam antara lain untuk&nbsp; meningkatkan&nbsp;\r\npengetahuan,&nbsp;&nbsp; pemahaman,&nbsp;&nbsp; dan&nbsp;\r\npengamalan&nbsp; ajaran Islam. Selain\r\nitu untuk meningkatkan&nbsp; pengalaman\r\nkepemimpinan&nbsp; dalam kepengurusan yang\r\nmampu menggerakkan pihak-pihak lain dalam berorganisasi Islam di SMK Kesehatan\r\nDarussalam untuk mengharumkan&nbsp;\r\nsyi’ar&nbsp; Islam&nbsp; di Bumi&nbsp;\r\nSerambi Mekkah. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><b><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">TUJUAN ROHIS SMK KESDA<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:1.0cm;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">Ekstrakurikuler\r\nRohis memiliki tujuan&nbsp; yaitu antara lain\r\nmemberikan pembekalan kepada pengurus Rohis SMK Kesehatan Darussalam Bergas\r\ntentang manajemen pengelolaan organisasi, sehingga diharapkan mampu\r\nmeningkatkan kualitas serta profesionalisme dalam melaksanakan program kerja\r\nekstrakurikuler Rohis. Tujuan selanjutnya yaitu menumbuhkan jiwa kepemimpinan\r\ndan rasa kepedulian sosial terbadap realitas yang berkembang, baik dilingkungan\r\nsekolah maupun di masyarakat. Kemudian, meningkatkan pengetahuan, ketrampilan,\r\nkemampuan serta pengalaman dalam manajemen pengelolaan organisasi Rohis SMK\r\nKesehatan Darussalam Bergas. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:1.0cm;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">Adapun program\r\nkegiatan ekstrakurikuler Rohis yaitu pembelajaran Islam lewat metode kelompok\r\nsetiap minggu, pembelajaran Islam di alam terbuka, perbaikan bacaan Alquran\r\ndengan tajwid aplikatif (tahsin), Baca Tulis AlQuran, marawis, sholawat,\r\nQiraat, pengajian bulanan dan masih banyak lagi. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height:normal\"><span lang=\"IN\" style=\"font-family:\r\n&quot;Times New Roman&quot;,serif\">&nbsp;</span></p>\r\n\r\n<table class=\"MsoTable15Plain4\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"705\" style=\"width: 528.6pt;\">\r\n <tbody><tr style=\"mso-yfti-irow:-1;mso-yfti-firstrow:yes;mso-yfti-lastfirstrow:yes;\r\n  mso-yfti-lastrow:y