INSERT INTO `page` VALUES (24, NULL, NULL, NULL, 'PMR', 'pmr', NULL, NULL, '<div class=\"WordSection1\">\r\n\r\n<p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span lang=\"EN-US\" style=\"font-size:22.0pt;line-height:115%;font-family:\r\n&quot;Adobe Garamond Pro Bold&quot;,serif\">Profil Ekstrakurikuler Palang Merah Remaja &nbsp;(PMR)<o:p></o:p></span></b></p>\r\n\r\n</div><p>\r\n\r\n<b><span lang=\"EN-US\" style=\"font-size:22.0pt;\r\nline-height:115%;font-family:&quot;Adobe Garamond Pro Bold&quot;,serif;mso-fareast-font-family:\r\nCalibri;mso-fareast-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\"><br clear=\"all\" style=\"page-break-before:auto;\r\nmso-break-type:section-break\">\r\n</span></b>\r\n\r\n</p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"EN-US\">&nbsp;</span></p><div>\r\n\r\n<table cellspacing=\"0\" cellpadding=\"0\" hspace=\"0\" vspace=\"0\" align=\"left\">\r\n <tbody><tr>\r\n  <td valign=\"top\" align=\"left\" style=\"padding-top:0cm;padding-right:0cm;\r\n  padding-bottom:0cm;padding-left:0cm\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  35.15pt;mso-line-height-rule:exactly;page-break-after:avoid;vertical-align:\r\n  baseline;mso-element:dropcap-dropped;mso-element-wrap:around;mso-element-anchor-vertical:\r\n  paragraph;mso-element-anchor-horizontal:column;mso-height-rule:exactly;\r\n  mso-element-linespan:2\"><span lang=\"EN-US\" style=\"font-size:38.0pt;mso-bidi-font-size:\r\n  10.0pt;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\n  mso-hansi-theme-font:major-latin;mso-text-raise:1.0pt\">P<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:\r\n&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin\">alang\r\n&nbsp;Merah &nbsp;Remaja atau biasa &nbsp;disebut PMR ialah salah satu Ekstrakurikuler &nbsp;yang &nbsp;ada\r\n&nbsp;di SMK Kesehatan Darussalam Bergas. PMR\r\nadalah wadah pembinaan dan pengembangan anggota remaja PMI. Anggota PMR\r\nmerupakan salah satu kekuatan PMI dalam melaksanakan kegiatan-kegiatan\r\nkemanusiaan. &nbsp;Selain itu, PMR juga\r\nsebagai pengembangan kapasitas organisasi PMI, serta mempromosikan\r\nprinsip-prinsip dasar&nbsp; gerakan palang\r\nmerah dan bulan sabit merah internasional. Adanya&nbsp; ekstrakurikuler PMR bertujuan untuk membangun\r\ndan mengembangkan karakter kepalangmerahan agar siap menjadi relawan PMI. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n31.5pt;line-height:150%\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ekstrakurikuler PMR di SMK\r\nKesehatan Darussalam Bergas menjadi salah satu kegiatan yang banyak diminati.\r\nKegiatan ekstrakurikuler ini, tidak hanya terbatas pada kegiatan <i>classical</i>, </span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">namun </span><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">anggota PMR dilatih untuk bisa bersosialisasi di masyarakat\r\numum terutama dalam kegiatan bakti sosial, tanggap bencana</span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> dan masih banyak lagi</span><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">. Saat ini, PMR SMK Kesehatan Darussalam Bergas telah bekerja\r\nsama dengan BSMR Kab</span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">upaten</span><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> Semarang dalam hal pelatihan calon anggota PMR, pemeriksaan\r\ngratis untuk masyarakat, penggalangan dana bantuan untuk bencana alam, serta\r\npelaksanaan lomba PMR tingkat kabupaten.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n36.0pt;line-height:150%\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Dalam pelaksanaan kegiatan, anggota\r\nPMR dibekali dengan keterampilan untuk melakukan pertolongan pertama pada\r\nkecelakaan (P3K), pemeriksaan tanda-tanda vital (tekanan darah, nadi,\r\npernafasan dan suhu), pemeriksaan darah, pengetahuan tentang obat-obatan\r\nsederhana, dan pengetahuan tentang penyakit sederhana. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n150%\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">&nbsp;</span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align: center; margin-bottom: 0cm; line-height: 150%;\"><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"Picture_x0020_1\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\"\r\n style=\'width:452pt;height:254.5pt;visibility:visible;mso-wrap-style:square\'>\r\n <v:imagedata src=\"file:///C:/Users/DELL/AppData/Local/Temp/msohtmlclip1/01/clip_image001.jpg\"\r\n  o:title=\"\"/>\r\n</v:shape><![endif]--><!--[if !vml]--><img width=\"603\" height=\"339\" src=\"data:image/jpeg;base64,\" v:shapes=\"Picture_x0020_1\" style=\"width: 544.552px; height: 306.141px;\"><!--[endif]--></span><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p>', NULL);
