lang=\"EN-US\" style=\"font-size:20.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">r</span></b><b><span lang=\"IN\" style=\"font-size:20.0pt;\r\nfont-family:&quot;Times New Roman&quot;,serif\">ikuler Pramuka<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US;\r\nmso-no-proof:yes\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span><span lang=\"EN-US\" style=\"font-family:\r\n&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US;mso-no-proof:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;&nbsp;</span><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>\r\n\r\n</div><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\">\r\n\r\n<span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:IN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\"><br clear=\"all\" style=\"page-break-before:auto;mso-break-type:section-break\">\r\n</span>\r\n\r\n</p><div class=\"WordSection2\">\r\n\r\n<div>\r\n\r\n<table cellspacing=\"0\" cellpadding=\"0\" hspace=\"0\" vspace=\"0\" align=\"left\">\r\n <tbody><tr>\r\n  <td valign=\"top\" align=\"left\" style=\"padding-top:0cm;padding-right:0cm;\r\n  padding-bottom:0cm;padding-left:0cm\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  35.15pt;mso-line-height-rule:exactly;page-break-after:avoid;vertical-align:\r\n  baseline;mso-element:dropcap-dropped;mso-element-wrap:around;mso-element-anchor-vertical:\r\n  paragraph;mso-element-anchor-horizontal:column;mso-height-rule:exactly;\r\n  mso-element-linespan:2\"><span lang=\"IN\" style=\"font-size:37.0pt;mso-bidi-font-size:\r\n  10.0pt;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\n  mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\n  mso-text-raise:1.5pt\">G<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:150%\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\">erakan pramuka adalah gerakan kepanduan nasional Indonesia.\r\nGerakan Pramuka<span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> mendidik dan membina\r\nkaum muda Indonesia guna mengembangkan mental, moral, spiritual, emosional,\r\nsosial, intelektual dan fisiknya. </span>Gerakan Pramuka yang diresmikan\r\nberdirinya pada tanggal 14 Agustus 1961 merupakan kesinambungan gerakan\r\nkepanduan nasional Indonesia yang bertujuan menumbuhkan tunas bangsa menjadi\r\ngenerasi yang dapat menjaga keutuhan, persatuan dan kesatuan bangsa, bertanggungjawab\r\nserta mampu mengisi kemerdekaan Indonesia.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:21.3pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\">Kegiatan ekstrakurikuler Praja Muda Karana, atau biasa akrab\r\ndisebut Pramuka, menjadi kegiatan ekstrakurikuler (ekskul) wajib bagi peserta\r\ndidik di SMK Kesehatan Darussalam Bergas. Tujuan Ambalan dalam pramuka adalah\r\nterwujudnya anggota yang dipersiapkan menjadi (1) manusia yang berwatak,\r\nberkepribadian, berakhlak mulia, tinggi kecerdasan, dan keterampilannya serta\r\nsehat jasmaninya; (2) warga negara yang berjiwa Pancasila, setia dan patuh\r\nkepada Negara Kesatuan Republik Indonesia serta menjadi anggota masayarakat\r\nyang baik dan berguna, yang dapat membangun dirinya sendiri secara mandiri\r\nserta bersama-sama bertanggung jawab atas pembangunan bangsa dan negara, memiliki\r\nkepedulian terhadap sesama hidup dan alam lingkungan baik tingkat lokal,\r\nnasional maupun internasional. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:21.3pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\">Sasaran pendidikan kepramukaan adalah mempersiapkan anggota\r\nAmbalan menjadi kader bangsa yang (1) berbudi pekerti luhur, disiplin,\r\nbertanggung jawab, dan dapat dipercaya dalam berpikir, berkata, bersikap dan\r\nberperilaku. (2) Memiliki jiwa patriot dan kepemimpinan yang berwawasan luas\r\nberlandaskan nilai-nilai kejuangan. (3)Mampu berkarya dan berwirausaha dengan\r\nsemangat kemandirian, kebersamaan, kepedulian, kreatif dan inovatif. (4)\r\nMelestarikan budaya dan alam Indonesia. <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:21.3pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\">Adapun program kerja ekstrakulikuler ini antara lain\r\nPenerimaan Tamu Ambalan, musyawarah Ambalan dimana menghasilkan program kerja\r\ndi setiap periode, Kemah Raya, serta Pelantikan Bantara. Pramuka juga mengikuti\r\nLomba Penggalang se-Kabupaten Semarang, dan pertemuan rutin di setiap hari Jumat.\r\nNama Ambalan di Pramuka ini yaitu Avicenna Rufaida. Maksudnya ialah </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN\">sebagai simbol ambalan, dengan harapan para anggota\r\nPramuka Penegak putra SMK Kesehatan Darussalam memiliki jiwa tangguh dan\r\npantang putus asa seperti Avicenna yang terus belajar walaupun beliau sudah\r\nmenguasai berbagai disiplin ilmu. Beliau tidak pernah menyia-nyiakan waktu yang\r\ndimilikinya dan selalu memanfaatkan setiap detik dalam hidupnya untuk\r\nmengembangkan potensi diri hingga mencapai batas-batas kemampuannya.</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-indent:21.3pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\">Adapun maksud dari Rufaida ialah </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:IN\">Maksud dan tujuan pangkalan SMK Kesehatan Darussalam\r\nmemilih Rufaida sebagai nama ambalan karena Rufaida merupakan sosok wanita yang\r\ncerdas dan berkepribadian luhur, dibuktikan dengan kemampuannya dalam\r\nmengembangkan ilmu keperawatan dan kesediannya untuk merawat setiap muslim,\r\nentah kaya ataupun miskin. Pangkalan SMK Kesehatan Darussalam menginginkan\r\nadanya Rufaida - Rufaida muda yang memiliki pemikiran cerdas, berkembang, dan\r\nmatang yang melalui pertimbangan- pertimbangan logis bukan hanya berdasarkan\r\nperasaan belaka seperti kebanyakan wanita. Diharapkan Pramuka Penegak putri\r\ntidak secara sepihak mengambil keputusan dalam suatu keadaan yang justru dapat\r\nmerugikan kepentingan bersama. Diharapkan pula bersama-sama ambalan Avicenna\r\nuntuk terus&nbsp; berjuang&nbsp; memajukan Pramuka dipangkalan SMK Kesehatan\r\nDarussalam, tanpa memandang&nbsp;<i><span style=\"border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm\">gender</span></i>&nbsp;entah\r\npria atau wanita. Sehingga pramuka penegak putri bisa ikut berkiprah dalam\r\ngerakan Pramuka SMK Kesehatan Darussalam. Kaum putri bukanlah lagi\r\nsekedar&nbsp;<i><span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0cm;\r\npadding:0cm\">kanca wingking</span></i>&nbsp;bagi para pria, namun kaum putri\r\nharus mampu memiliki andil dalam perancangan, pembuatan, serta pengambil\r\nkeputusan, seperti yang dilakukan sosok Rufaida.</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-hansi-theme-font:major-latin;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p>\r\n\r\n</div><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center;line-height:normal\">\r\n\r\n<b><span lang=\"IN\" style=\"font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;border:none windowtext 1.0pt;\r\nmso-border-alt:none windowtext 0cm;padding:0cm;mso-ansi-language:IN;mso-fareast-language:\r\nIN;mso-bidi-language:AR-SA\"><br clear=\"all\" style=\"page-break-before:auto;\r\nmso-break-type:section-break\">\r\n</span></b>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><b><span lang=\"IN\" style=\"font-family: &quot;Times New Roman&quot;, serif; border: 1pt none windowtext; padding: 0cm;\">&nbsp;&nbsp;</span></b><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:IN\"><o:p></o:p></span></p><table class=\"MsoTable15Plain4\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n <tbody><tr>\r\n  <td width=\"304\" valign=\"top\" style=\"width:227.85pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;mso-yfti-cnfc:5\"><b><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-ansi-language:EN-US;mso-no-proof:yes\"><!--[if gte vml 1]><v:shape id=\"Picture_x0020_5\"\r\n   o:spid=\"_x0000_i1027\" type=\"#_x0000_t75\" style=\'width:209pt;height:156.5pt;\r\n   visibility:visible;mso-wrap-style:square\'>\r\n   <v:imagedata src=\"file:///C