r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span lang=\"EN-US\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-ansi-language:EN-US\">&nbsp;</span></p></div>', NULL);
INSERT INTO `page` VALUES (26, NULL, NULL, NULL, 'PSHT', 'psht', NULL, NULL, '<div class=\"WordSection1\">\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; text-indent: 21.3pt; line-height: normal;\"><b><span lang=\"EN-US\" style=\"font-size:18.0pt;font-family:&quot;Adobe Caslon Pro&quot;,serif;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:EN-US\">Profil </span></b><b><span lang=\"IN\" style=\"font-size:18.0pt;\r\nfont-family:&quot;Adobe Caslon Pro&quot;,serif;mso-bidi-font-family:&quot;Times New Roman&quot;\">Ekstraku</span></b><b><span lang=\"EN-US\" style=\"font-size:18.0pt;\r\nfont-family:&quot;Adobe Caslon Pro&quot;,serif;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-US\">r</span></b><b><span lang=\"IN\" style=\"font-size:18.0pt;font-family:&quot;Adobe Caslon Pro&quot;,serif;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\">ikuler Persaudaraan Setia Hati </span></b><b><span lang=\"EN-US\" style=\"font-size:18.0pt;\r\nfont-family:&quot;Adobe Caslon Pro&quot;,serif;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-US\">Terate</span></b><span lang=\"EN-US\" style=\"font-size: 18pt; font-family: &quot;Adobe Caslon Pro&quot;, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-fareast-language:IN;mso-no-proof:\r\nyes\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></p></div><p>\r\n\r\n</p><div>\r\n\r\n<table cellspacing=\"0\" cellpadding=\"0\" hspace=\"0\" vspace=\"0\" align=\"left\">\r\n <tbody><tr>\r\n  <td valign=\"top\" align=\"left\" style=\"padding-top:0cm;padding-right:0cm;\r\n  padding-bottom:0cm;padding-left:0cm\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  35.15pt;mso-line-height-rule:exactly;page-break-after:avoid;vertical-align:\r\n  baseline;mso-element:dropcap-dropped;mso-element-wrap:around;mso-element-anchor-vertical:\r\n  paragraph;mso-element-anchor-horizontal:column;mso-height-rule:exactly;\r\n  mso-element-linespan:2\"><span lang=\"IN\" style=\"font-size: 38pt; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">P</span><span lang=\"IN\" style=\"font-size: 38pt; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table><span lang=\"IN\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">ersaudaraan Setia Hati Terate</span><span lang=\"IN\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\"> </span><span lang=\"IN\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">yang disingkat PSHT\r\nialah organisasi olahraga yang diinisiasi oleh&nbsp;</span><span lang=\"IN\" style=\"text-align: justify;\"><a href=\"https://id.wikipedia.org/wiki/Ki_Hadjar_Hardjo_Oetomo\" title=\"Ki Hadjar Hardjo Oetomo\"><span style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ki Hadjar\r\nHardjo Oetomo</span></a></span><span lang=\"IN\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">&nbsp;pada tahun 1922\r\ndan kemudian disepakati namanya menjadi PSHT pada kongres pertamanya di&nbsp;</span><span lang=\"IN\" style=\"text-align: justify;\"><a href=\"https://id.wikipedia.org/wiki/Madiun\" title=\"Madiun\"><span style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Madiun</span></a></span><span lang=\"IN\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">&nbsp;pada\r\ntahun&nbsp;</span><span lang=\"IN\" style=\"text-align: justify;\"><a href=\"https://id.wikipedia.org/wiki/1948\" title=\"1948\"><span style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1948</span></a></span><span lang=\"IN\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">. PSHT\r\nmerupakan organisasi pencak silat yang tergabung dan salah satu yang turut\r\nmendirikan&nbsp;</span><span lang=\"IN\" style=\"text-align: justify;\"><a href=\"https://id.wikipedia.org/wiki/Ikatan_Pencak_Silat_Indonesia\" title=\"Ikatan Pencak Silat Indonesia\"><span style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Ikatan\r\nPencak Silat Indonesia</span></a></span><span lang=\"IN\" style=\"text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 150%; font-family: Cambria, serif;\">&nbsp;(IPSI) pada\r\ntanggal 18 Mei 1948.</span></div><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:21.3pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-fareast-language:IN;mso-bidi-font-style:italic\">PSHT menjadi\r\nsalah</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-ansi-language:EN-US;mso-fareast-language:IN;mso-bidi-font-style:\r\nitalic\"> satu</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-fareast-language:IN;mso-bidi-font-style:italic\">\r\nekstrakurikuler favorit siswa-siswi SMK Kesehatan Darussalam</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-ansi-language:EN-US;mso-fareast-language:IN;mso-bidi-font-style:\r\nitalic\"> Bergas</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-fareast-language:IN;mso-bidi-font-style:italic\">. Jumlah\r\nsiswa yang mengikuti kegiatan ekstra ini kurang lebih sebanyak 30 siswa. Dalam\r\npelaksanaan kegiatan harian, peserta ekstrakurikuler dilatih oleh pelatih yang\r\nprofesional, yakni Bapak Imam Abu Mansyur</span><span lang=\"EN-US\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-ansi-language:EN-US;mso-fareast-language:IN;mso-bidi-font-style:\r\nitalic\">, S.E</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-fareast-language:IN;mso-bidi-font-style:italic\">. Selain\r\nsebagai pelatih, beliau juga aktif sebagai atlet pencak silat PSHT. Beliau juga\r\npernah mengikut kejuaraan tingkat provinsi dan nasional.</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-ansi-language:EN-US;mso-fareast-language:IN;mso-bidi-font-style:\r\nitalic\"> </span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;\r\nfont-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-fareast-language:IN;mso-bidi-font-style:italic\">Ekstrakurikuler\r\nPSHT SMK Kesehatan Darussalam</span><span lang=\"EN-US\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-theme-font:major-latin;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:#222222;mso-ansi-language:EN-US;\r\nmso-fareast-language:IN;mso-bidi-font-style:italic\"> Bergas</span><span lang=\"IN\" style=\"font-size:10.0pt;line-height:150%;font-family:&quot;Cambria&quot;,serif;\r\nmso-ascii-theme-font:major-latin;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#222222;mso-fareast-language:IN;mso-bidi-font-style:italic\"> telah\r\nmencetak atlet-atlet muda yang siap bertanding baik tingkat daerah maupun\r\ntingkat nasional. Adapun berbagai perlombaan telah diikuti, antara lain Jogja\r\nCampionship tingkat Nasional, Kejuaraan Kabupaten, Pekan olah raga Daerah,\r\nPekan Olah Raga Pondok Pesantren. </span><span lang=\"IN\" style=\"font-size:10.0pt;\r\nline-height:150%;font-family:&quot;Cambria&quot;,serif;mso-ascii-theme-font:major-latin;\r\nmso-hansi-theme-font:major-latin;mso-bidi-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-indent:21.3pt;line-height:\r\n150%\"><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">PSHT\r\nSMK Kesehatan Darussalam </span><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Bergas\r\n</span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">mengadakan\r\nlatihan untuk para siswa di setiap hari Senin, Rabu, dan Jum’at secara rutin.\r\nDengan prinsip dan jiwa ksatria, anggota PSHT selalu berlatih dengan\r\nsungguh-sungguh. Adapun manfaat mengikuti ekstrakulikuler ini selain dapat\r\nmenjaga stamina dan kesehatan tubuh, kegiatan ini juga dapat memacu adrenalin,\r\nmenumbuhkan rasa percaya diri serta dapat mengasah daya fokus dalam diri. PSHT\r\nialah organisasi yang universal, tidak sedikit di luar sekolah yang menjadi\r\nanggota PSHT. Maka dari itu, dengan mengikuti ekstrakulikuler PSHT SMK\r\nKesehatan Darussalam </span><span lang=\"EN-US\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Bergas </span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">juga pasti menambah relasi yang\r\nlebih luas, sehingga anggota mendapatkan banyak rekan dalam organisasi ini. </span><span lang=\"IN\" style=\"font-size: 10pt; line-height: 150%; font-family: Cambria, serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal;\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif;mso-no-proof:yes\"><!--[if gte vml 1]><v:shapetype\r\n id=\"_x0000_t75\" coordsize=\"21600,21600\" o:spt=\"75\" o:preferrelative=\"t\"\r\n path=\"m@4@5l@4@11@9@11@9@5xe\" filled=\"f\" stroked=\"f\">\r\n <v:stroke joinstyle=\"miter\"/>\r\n <v:formulas>\r\n  <v:f eqn=\"if lineDrawn pixelLineWidth 0\"/>\r\n  <v:f eqn=\"sum @0 1 0\"/>\r\n  <v:f eqn=\"sum 0 0 @1\"/>\r\n  <v:f eqn=\"prod @2 1 2\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelWidth\"/>\r\n  <v:f eqn=\"prod @3 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @0 0 1\"/>\r\n  <v:f eqn=\"prod @6 1 2\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelWidth\"/>\r\n  <v:f eqn=\"sum @8 21600 0\"/>\r\n  <v:f eqn=\"prod @7 21600 pixelHeight\"/>\r\n  <v:f eqn=\"sum @10 21600 0\"/>\r\n </v:formulas>\r\n <v:path o:extrusionok=\"f\" gradientshapeok=\"t\" o:connecttype=\"rect\"/>\r\n <o:lock v:ext=\"edit\" aspectratio=\"t\"/>\r\n</v:shapetype><v:shape id=\"Picture_x0020_1\" o:spid=\"_x0000_i1025\" type=\"#_x0000_t75\"\r\n style=\'width:452pt;height:301pt;visibility:visible;mso-wrap-style:square\'>\r\n <v:imagedata src=\"file:///C:/Users/DELL/AppData/Local/Temp/msohtmlclip1/01/clip_image001.jpg\"\r\n  o:title=\"\"/>\r\n</v:shape><![endif]--><!--[if !vml]--><img border=\"0\" width=\"603\" height=\"401\" src=\"data:image/jpeg;base64,\" v:shapes=\"Picture_x0020_1\"><!--[endif]--></span><span lang=\"IN\" style=\"font-family:\r\n&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify;line-height:normal\"><span lang=\"IN\" style=\"font-family:&quot;Times New Roman&quot;,serif\">&nbsp;</span></p>', NULL);

