-- ----------------------------
INSERT INTO `profil_kepala_sekolah` VALUES (1, 'kepsek.jpg', 'Muhaimin,S.Ag., M.Pd.', 'Bergas', '<p class=\"demoTitle\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p data-start=\"192\" data-end=\"227\"><strong data-start=\"192\" data-end=\"227\">SMK Kesehatan Darussalam Bergas</strong></p><p data-start=\"229\" data-end=\"310\"><em data-start=\"229\" data-end=\"275\">Assalamu’alaikum warahmatullahi wabarakatuh.</em><br data-start=\"275\" data-end=\"278\"> Salam sejahtera bagi kita semua.</p><p data-start=\"312\" data-end=\"578\">Puji syukur kita panjatkan ke hadirat Allah SWT, Tuhan Yang Maha Esa, karena atas rahmat dan karunia-Nya, SMK Kesehatan Darussalam Bergas terus berkembang menjadi salah satu sekolah kejuruan kesehatan yang unggul, berkarakter, dan berdaya saing tinggi di era global.</p><p data-start=\"580\" data-end=\"985\">Sebagai Kepala Sekolah, saya merasa bangga dan bersyukur melihat semangat belajar siswa-siswi kami yang luar biasa, didukung oleh tenaga pendidik profesional dan fasilitas pendidikan yang terus kami tingkatkan. SMK Kesehatan Darussalam Bergas tidak hanya membekali siswa dengan keterampilan dan pengetahuan di bidang kesehatan, tetapi juga menanamkan nilai-nilai karakter, keimanan, dan kepedulian sosial.</p><p data-start=\"987\" data-end=\"1336\">Kami berkomitmen untuk menciptakan lulusan yang <strong data-start=\"1035\" data-end=\"1151\">terampil, beretika, dan siap bersaing di dunia kerja maupun melanjutkan ke jenjang pendidikan yang lebih tinggi.</strong> Kurikulum kami dirancang selaras dengan kebutuhan dunia industri dan dunia kerja (DUDI), serta didukung dengan program praktik kerja lapangan di berbagai institusi kesehatan terkemuka.</p><p data-start=\"1338\" data-end=\"1494\">Kami juga mengajak para orang tua, masyarakat, serta seluruh mitra kerja untuk terus bersinergi demi kemajuan pendidikan di SMK Kesehatan Darussalam Bergas.</p><p data-start=\"1496\" data-end=\"1654\">Akhir kata, semoga Allah SWT senantiasa memberikan bimbingan, kekuatan, dan keberkahan bagi kita semua dalam mencerdaskan kehidupan bangsa melalui pendidikan.</p><p data-start=\"1656\" data-end=\"1703\"><em data-start=\"1656\" data-end=\"1703\">Wassalamu’alaikum warahmatullahi wabarakatuh.</em></p><p data-start=\"1705\" data-end=\"1819\"><strong data-start=\"1705\" data-end=\"1723\">Kepala Sekolah</strong><br data-start=\"1723\" data-end=\"1726\"> <strong data-start=\"1726\" data-end=\"1761\">SMK Kesehatan Darussalam Berga</strong></p><p data-start=\"1705\" data-end=\"1819\"><strong data-start=\"1726\" data-end=\"1761\"><br></strong></p><p data-start=\"1705\" data-end=\"1819\"><strong data-start=\"1726\" data-end=\"1761\">Muhaimin,S.Ag.,M.Pd.</strong></p>');

